INSERT INTO `product-service` (`id`, `title`, `dec`, `img`, `category`, `created_at`) VALUES
(7, '<p><span class=\"ql-size-large\">Epoxy Floor coating Products Range</span></p>', '<p><span class=\"ql-size-large\">Sathya - Epoxy Floor coatings offer the following parameters </span></p><ul><li><strong style=\"color: black;\" class=\"ql-size-large\">uniform surface with the gloss level of choice â€“ high, semi, or matte</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Brightness in an area with such a floor coating system increases by as much as 200%</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">A hard wearing, durable surface that can withstand heavy and continuous traffic</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Resists oil stains, beads water, and wipes super clean and will create a seamless surface</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Can combine with paints and colors to mask chips and cracks in the underlying floor</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Provide a chemically resistant surface ideal for manufacturing plants</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Enhanced safety by creating an anti-slip surface that is heat and fire resistant</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Patterns can be designed to create driveways and/or identify walkable areas</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Prevents wear and tear to the underlying concrete floor &amp; reduces maintenance costs</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Prevents seepage of spills through concrete â€“ safe, eco-friendly solution</strong></li><li><strong style=\"color: black;\" class=\"ql-size-large\">Can apply over new or old concrete; when applied properly, can last several years</strong></li></ul>', '../uploads/Products_Services/Cummins floor coating Hosur.jpg', 'hello', '2025-04-02 10:27:27');
