INSERT INTO `product-service` (`id`, `title`, `dec`, `img`, `category`, `created_at`) VALUES
(21, '<p><span class=\"ql-size-small\">WE OFFER COMPREHENSIVE SOLUTIONS USING OUR PRODUCTS</span></p>', '<ul data-checked=\"false\"><li>Installation of liquid applied floor coatings having Epoxy, PU &amp; EPU chemistry</li><li>Repair &amp; Rehabilitation of aged concrete floor with anti-dusting solution</li><li>Repair &amp; Rehabilitation of aged floor coatings of various kinds </li><li>Installation of slip-resistant car park &amp; drive -way floor coatings with safety line markings</li><li>Installation of energy efficient &amp; heat reducing coatings for various types of roofs</li><li>Installation of Hygienic coatings for floor, wall &amp; ceiling in Hospitals, pharma manufacturing units &amp; Food processing units</li></ul>', '../uploads/Products_Services/Floor coating in Awin milk product.jpg', 'COMPREHENSIVE SOLUTIONS', '2025-04-06 11:17:57');
